    val nums1 = intArrayOf(4,5,6,0,0,0)//intArrayOf(1,2,3,0,0,0)
    val nums2 = intArrayOf(1,2,3)//intArrayOf(2,5,6)
    val merged = MergeSortedArray().merge(nums1, 3, nums2, 3)
   // println(merged)

}

class MergeSortedArray {
    fun merge(nums1: IntArray, m: Int, nums2: IntArray, n: Int): Unit {
        val tempArray = IntArray(m+n)
        var idx =m

        nums1.forEachIndexed{index, i ->
            if (index>=m)
                return@forEachIndexed
            tempArray[index] = i
        }
        nums2.forEachIndexed{index, i ->
            if (index>=n)
                return@forEachIndexed
            if(idx-1>=0 && tempArray[idx-1]>i) {
                tempArray[idx] = tempArray[idx-1]
                tempArray[idx-1] = i
            } else {
                tempArray[idx] = i
            }

            idx++
        }

        tempArray.copyInto(nums1)
        print(nums1.toList())
    }
}